import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import Map from './Map';
import Login from './Login';


const App: React.FC = () => {
  return (
    // <div className="App">
    //   <Map />
    // </div>
    <Router>
      <div className="App">
        <Route path="/">
          <Route path="/map" />
        </Route>
        <Route path="/login" Component={Login} />
        <Route path="/map" Component={Map} />

      </div>
    </Router>
  );
}

export default App;
